INSERT INTO `projekt` (`id`, `naslov`, `kratki`, `sadrzaj`, `kategorija`, `arhiva`, `slika`) VALUES
(27, 'Piastri vodi McLarenov 1-2 ispred Norrisa na VN Španjolske', 'Oscar Piastri dodatno je učvrstio svoje vodstvo u prvenstvu ostvarivši uvjerljivu pobjedu na Velikoj nagradi Španjolske', 'Piastri je odlično startao s pole positiona, omogućivši 24-godišnjaku da rano stekne vodstvo ispred Verstappena koji je prestigao Norrisa u prvom zavoju. Norris je kasnije ponovno preuzeo poziciju - samo da bi Verstappen preskočio oba McLarena nakon prvih zaustavljanja u boksu i plasirao se na prvo mjesto.\r\n\r\nMeđutim, to se pokazalo kratkim, jer je Nizozemac rano ušao u boks za drugo zaustavljanje, vraćajući vodstvo Piastriju - sve je to izazvalo veliku intrigu oko toga hoće li se Verstappen odlučiti za strategiju s tri zaustavljanja, scenarij koji bi mogao predstavljati prijetnju ekipi Papaya ako Red Bull kasnije bude imao svježije gume.\r\n\r\nVerstappen je doista krenuo s tri zaustavljanja - ali cijela slika je dramatično poremećena kada je sigurnosni automobil raspoređen u kasnijim fazama nakon što je Kimi Antonellijev Mercedes sišao sa staze zbog mehaničkog problema, što je navelo većinu vodećih vozača da ponovno uđu u boks.Dok su Piastri i Norris na ponovnom startu prodrli u šest krugova utrke do zastavice, Verstappen je prestigao Charlesa Leclerc i zauzeo treće mjesto prije nego što se borio s Russellom. Dvojica su se sudarila i Verstappen je bio prisiljen sići s ceste, samo da bi Red Bull rekao svom vozaču da vrati poziciju.\r\n\r\nZatim je došlo do još jednog sudara između dvojice vozača zbog kojeg je Verstappen naknadno dobio kaznu od 10 sekundi. No, za Piastrija nije bilo takvih drama, koji je osigurao svoju petu pobjedu sezone ispred momčadskog kolege iz McLarena, Norrisa.\r\n\r\nLeclerc je osigurao posljednje mjesto na postolju za Ferrari na trećem mjestu, dok je Russell osvojio četvrto, a Nico Hulkenberg bio je privlačan peti za Kick Sauber nakon što su krenuli s 15. pozicije.', 'sport', 0, );
INSERT INTO `projekt` (`id`, `naslov`, `kratki`, `sadrzaj`, `kategorija`, `arhiva`, `slika`) VALUES
(28, 'Charles Leclerc nakon VN Španjolske', 'Uz Georgea Russella, Charles Leclerc bio je još jedna strana upletena u dramu u završnici utrke u Španjolskoj u kojoj je Max Verstappen izgubio postolje', 'Leclerc je uspio osvojiti svoj drugi uzastopni podij zahvaljujući kasnoj akciji, koja je omogućena nakon što je sigurnosni automobil zgusnuo vozače i smjestio ga direktno iza Verstappena.S vozačem Red Bulla na novim tvrdim gumama, kojima treba dulje da steknu potrebno prianjanje, imao je zastrašujući trenutak pri izlasku iz posljednjeg zavoja u kojem je jedva zadržao automobil na stazi.\r\n\r\nPogreška je pomogla Leclercu da se približi i prestigne Nizozemca, ali njih dvojica su se nakratko susreli tijekom pretjecanja, što je potonjeg navelo da bjesni preko radija: „Upravo se zabio u mene! To je kazna.“Ferrarijev vozač se zadržao na trećem mjestu nekoliko preostalih krugova, dok su stvari krenule nizbrdo za Verstappena jer je kažnjen nakon sudara s Russellom i dobio je 10 sekundi vremenske kazne zbog izazivanja sudara, što ga je spustilo na 10. mjesto.\r\n\r\n„Sigurnosni automobil nam je pomogao“, kasnije je sažeo Leclerc. „U osnovi, Max nije imao gume osim tvrdih guma, što ga je dovelo u lošu situaciju. Iskoristili smo to.“', 'sport', 0, );
INSERT INTO `projekt` (`id`, `naslov`, `kratki`, `sadrzaj`, `kategorija`, `arhiva`, `slika`) VALUES
(29, 'Sučić se emotivno oprostio od Dinama: Ne znam što da mislim, još uvijek mi je ovo nestvarno', 'Emotivan oproštaj Sučića od Dinama: Ne znam što da mislim, još uvijek mi je ovo nestvarno', 'Još uvijek mi zvuči nestvarno da mi je došao kraj u Dinamu. Ne znam ni što da mislim, ni kako da mislim, poručio je Petar Sučić (21), koji je u srijedu službeno postao novi igrač milanskog Intera, koji je prošlog vikenda igrao finale Lige prvaka. Dinamo je svojem dojučerašnjem igraču posvetio poseban video i objavio oproštajni intervju sa Sučićem.- U dvije sezone smo prošli svašta, lani smo osvojili dvostruku krunu, ova sezona nije takva, ali imali smo povijesni uspjeh u Ligi prvaka i nekih slatkih pobjeda. Još uvijek mi je sve malo nadrealno. Kao dječak sam sanjao igrati za Dinamo, a kad sam ovdje dobio priliku dao sam sve od sebe i nisam htio da mi to isklizne iz ruku. Sve osim Dinama i reprezentacije je samo plus i nadogradnja na moju karijeru. Ove dvije godine su mi najljepše u karijeri, a sad slijedi novo poglavlje u Interu - rekao je Sučić, koji vjeruje kako je Dinamo bio idealna priprema za ono što ga čeka u Interu. Mogu iskreno reći da sam osjetio što je pritisak i veličina jednog kluba. Samo kad nosiš grb Dinama osjetiš tu težinu kluba i osjetiš koliko je poseban. Dinamo mi je bio jako dobra škola za sve što slijedi, nisam mogao imati bolju pripremu za Inter, čvrsto stojim iza toga.', 'sport', 0, );
INSERT INTO `projekt` (`id`, `naslov`, `kratki`, `sadrzaj`, `kategorija`, `arhiva`, `slika`) VALUES
(41, 'Jandroković: Izdvajanje pet posto za obranu nužno zbog sigurnosne situacije', 'Hrvatska podržava povećanje izdvajanja za obranu na 5% BDP-a, Jandroković poručuje: sigurnost ima svoju cijenu i ulog je nužan.', 'Hrvatska prihvaća da se izdvajanje za obranu poveća na pet posto BDP-a jer je to nešto što je nužno i u njezinu interesu s obzirom na geopolitičke okolnosti, izjavio je u petak u Bruxellesu predsjednik Hrvatskoga sabora Gordan Jandroković.\r\n\r\n“Mi smo spremni u idućem razdoblju povećati izdvajanje za obranu i prihvatili smo tih pet posto kao nešto što je nužno, ne zato što je nečiji hir, nego zato što je došlo do bitno izmijenjene sigurnosne situacije u svijetu”, rekao je Jandroković, koji sudjeluje na Parlamentarnom samitu NATO-a koji se u organizaciji dvaju domova belgijskoga parlamenta i Parlamentarne skupštine NATO-a održava u Bruxellesu.\r\n\r\nJandroković je istaknuo da je povećanje troškova za obranu u hrvatskom interesu, da je riječ o preventivi, “a ne o tome da bi Hrvatska željela nekoga ugroziti ili napasti”.\r\n\r\n“Postoje nove ugroze i nove prijetnje i države koje nisu prijateljski orijentirane prema NATO-saveznicima i Europskoj uniji, pa se i u našem susjedstvu naoružavaju”, rekao je predsjednik Sabora. Jandroković je u svom govoru rekao da je Hrvatska od 2016. godine povećala svoj obrambeni proračun za gotovo 200 posto.\r\n\r\n“Hrvatska je svjesna kako ta ulaganja treba nastaviti povećavati. Stoga će na skorašnjem summitu šefova država i vlada zemalja članica NATO-a u nizozemskom Den Haagu podržati prijedlog da se usuglasi novi plan izdvajanja za obranu”, rekao je Jandroković.\r\n\r\nOčekuje se da će čelnici država članica NATO-a na svom samitu sljedeći tjedan u Den Haagu dogovoriti novi cilj izdvajanja za obranu u visini od pet posto BDP-a do 2032. godine. Od tih pet posto, 3,5 posto išlo bi na čisto vojne izdatke, a preostalih 1,5 posto na troškove za projekte koji imaju civilnu i vojnu svrhu.\r\n\r\nJandroković je rekao da globalno sigurnosno okruženje postaje sve složenije, o čemu svjedoči i aktualni sukob između Izraela i Irana.\r\n\r\n“Hrvatska sukobljene strane poziva na suzdržanost, smatrajući kako treba dati priliku diplomaciji, koliko god situacija bila teška. Pritom, vrlo je važan i angažman Međunarodne agencije za atomsku energiju kada je u pitanju iranski nuklearni program, koji predstavlja legitiman razlog za zabrinutost. Istodobno, važno je da aktualna eskalacija na Bliskom istoku ne pokoleba saveznike u sveobuhvatnoj potpori Ukrajini”, rekao je Jandroković, koji se zauzeo za nastavak pomoći Ukrajini u obrani od ruske agresije.\r\n\r\nI voditelj Izaslanstva Hrvatskoga sabora pri Parlamentarnoj skupštini NATO-a Dario Hrebak istaknuo je nužnost povećanja troškova za obranu.', 'politika', 0, );
INSERT INTO `projekt` (`id`, `naslov`, `kratki`, `sadrzaj`, `kategorija`, `arhiva`, `slika`) VALUES
(42, 'Američki sud dopustio Trumpu da zadrži kontrolu nad kalifornijskom Nacionalnom gardom', 'Demokratski guverner države nastavlja s tužbom kojom osporava zakonitost korištenja trupa za gušenje prosvjeda i nemira u LA-u', 'Američki žalbeni sud u četvrtak je dopustio Donaldu Trumpu da zasad zadrži kontrolu nad kalifornijskom Nacionalnom gardom, dok demokratski guverner države nastavlja s tužbom kojom osporava zakonitost korištenja trupa za gušenje prosvjeda i nemira u Los Angelesu.\r\n\r\nTročlano vijeće okružnog žalbenog suda SAD-a sa sjedištem u San Franciscu produžilo je pauzu koju je stavilo na presudu okružnog suca Charlesa Breyera od 12. lipnja da je Trump nezakonito pozvao Nacionalnu gardu u saveznu službu.\r\n\r\nBreyer je presudio da je Trump prekršio američki zakon koji regulira mogućnost predsjednika da preuzme kontrolu nad Nacionalnom gardom države time što se nije koordinirao s guvernerom, a također je utvrdio da uvjeti utvrđeni statutom koji bi dopustili ovaj potez, poput pobune protiv savezne vlasti, nisu postojali.\r\n\r\nBreyer je naredio Trumpu da vrati kontrolu nad kalifornijskom Nacionalnom gardom Newsomu, a nekoliko sati nakon što je Breyer djelovao, okružno vijeće privremeno je odgodilo sučev potez. Usred prosvjeda i previranja u Los Angelesu zbog Trumpovih imigracijskih racija, predsjednik je 7. lipnja preuzeo kontrolu nad kalifornijskom Nacionalnom gardom i rasporedio 4000 vojnika protivno željama Newsoma. Trump je također naredio slanje 700 američkih marinaca u grad nakon što je poslao Nacionalnu gardu. Breyer još nije donio odluku o zakonitosti mobilizacije marinaca.\r\n\r\nTrumpova odluka o slanju trupa u Los Angeles potaknula je nacionalnu raspravu o upotrebi vojske na tlu SAD-a i rasplamsala političke napetosti u drugom najmnogoljudnijem američkom gradu.\r\n\r\nProsvjedi u Los Angelesu trajali su više od tjedan dana, ali su potom jenjavali, što je navelo gradonačelnicu Los Angelesa Karen Bass da ukine policijski sat koji je uvela.', 'politika', 0, );
INSERT INTO `projekt` (`id`, `naslov`, `kratki`, `sadrzaj`, `kategorija`, `arhiva`, `slika`) VALUES
(43, 'Procurio strateški dokument njemačke vojske: ‘Rusija priprema veliki rat!‘', 'Rusija se dokazivo priprema za sukob protiv NATO-a, a osobito jačanjem snaga na zapadu Rusije, stoji u dokumentu', 'Njemačka vojska smatra Rusiju \"egzistencijalnim rizikom\" za zemlju i Europu, prema izvješću časopisu Spiegel koji je imao uvid u strateški dokument Bundeswehra.\r\n\r\nPovjerljiv dokument upozorava da Kremlj prilagođava svoju industriju i rukovodstvo \"kako bi zadovoljio potrebe za velik sukob protiv NATO-a do kraja ovog desetljeća\".\r\n\r\nRusija se dokazivo priprema za sukob protiv NATO-a, a osobito jačanjem snaga na zapadu Rusije, odnosno \"na granicama s NATO-om\", stoji u strateškom dokumentu, prema izvješću Spiegela.\r\n\r\nRusija bi već iduće godine mogla imati oko 1,5 milijuna aktivnih vojnika, prema dokumentu. Njemačka se toj prijetnji može suprotstaviti jedino \"postojanim razvojem vojske i sposobnostima na razini društva\", zaključuje dokument.\r\n\r\nVojni djelatnici i stručnjaci su tijekom proteklih 18 mjeseci pripremali strateški dokument kao smjernice za budući razvoj njemačkog Bundeswehra, objavio je Spiegel.\r\n\r\nMinistarstvo obrane nije odmah odgovorilo na zahtjev za komentarom. Njemački kancelar Friedrich Merz je nedavno podržao zahtjev američkog predsjednika Donalda Trumpa da se ciljevi NATO-a kada je riječ o izdvajanju za obranu povećaju na pet posto BDP-a, što predstavlja veliku promjenu politike omogućenu povijesnim ublažavanjem strogih njemačkih pravila o zaduživanju.\r\n\r\n', 'politika', 0, );
INSERT INTO `projekt` (`id`, `naslov`, `kratki`, `sadrzaj`, `kategorija`, `arhiva`, `slika`) VALUES
(44, 'Aston Martin najavljuje kako će Stroll propustiti VN Španjolske', 'Aston Martin je objavio da Lance Stroll neće sudjelovati na Velikoj nagradi Španjolske, a Kanađanin će se podvrgnuti liječničkom zahvatu nakon što je osjetio bol u ruci i zapešću.', 'Nakon sudjelovanja u kvalifikacijama na stazi Circuit de Barcelona-Catalunya – sesiju koju je završio na 14. mjestu – tim je nekoliko sati kasnije potvrdio da će Stroll propustiti ostatak vikenda. U izjavi koju je objavio Aston Martin stoji: „Tijekom proteklih šest tjedana Lance je osjećao bol u ruci i zapešću, za što njegov medicinski savjetnik vjeruje da je povezano sa zahvatom koji je podvrgnut 2023. godine.\r\n\r\n„Kao rezultat toga, njegov medicinski tim potvrdio je da sutra neće nastupati i da će se podvrgnuti zahvatu kako bi se riješili ti problemi prije nego što se usredotoči na oporavak.“\r\n\r\nStroll je zadobio prijelome i slomljen prst na nozi nakon biciklističke nesreće tijekom predsezone 2023. godine, što je dovelo do operacije, a zatim i procesa rehabilitacije. Vratio se na vrijeme za prvu utrku sezone. Dvadesetšestogodišnjak je završio tu utrku – Veliku nagradu Bahreina – na šestom mjestu, unatoč kasnijem otkrivanju da je njegov liječnički tim u početku sumnjao hoće li moći nastupiti u prvim utrkama sezone.\r\n\r\nUoči sezone 2024., Stroll je priznao da je usvojio oprezniji pristup svom programu treninga.', 'sport', 1, );

